    change(i) {
        const travelForm = this.state.travelForm;
        travelForm[i] = ['a'];
        console.log(travelForm);
        this.setState({ travelForm: travelForm })
    }

    renderTravelForm(i) {
        return (
            <TravelForm value={this.state.travelForm[i]} onChange={() => this.change(i)} />
        );
    }

    render() {
        return (
            <div>
